const inputStyle = {
    width: "100px",
    display: "block",
}

const submitButtonStyle = {
    width: "100px",
    display: "block",
}

class Form extends React.Component {

    render() {
        return (
            <form>
                <input 
                    style={inputStyle}
                />
                <button 
                    type="submit" 
                    style={submitButtonStyle}
                >
                    Add Task
                </ button>
            </form>
        )
    }
}

export default Form;
